// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import "./Ticket.sol";

contract Manager {
    event TicketCreated();

    Ticket ticket;

    constructor() {}

    function createTicket() public {
        string memory ticketName = "ticket1";
        uint256 date = block.timestamp;
        string memory eventDescription = "description";
        EventType eventType;
        TicketStatus status;
        TransferStatus transferStatus;

        ticket = new Ticket(
            ticketName,
            date,
            eventDescription,
            eventType,
            status,
            transferStatus
        );
        emit TicketCreated();
    }

    function showAllTickets() public {}

    function showTicketsByAddress() public {}

    function transferTicket() public {}

    function changeTicketPrice() public {}

    function showStatistics() public {}
}
